import React from "react";

const ProgressBar = ({ completedCount, overdueCount }) => {
  const total = completedCount + overdueCount;
  const completedPercentage = total ? (completedCount / total) * 100 : 0;
  const overduePercentage = total ? (overdueCount / total) * 100 : 0;

  return (
    <div>
      <h3>Assignment Progress</h3>
      <div
        style={{
          display: "flex",
          height: "20px",
          width: "100%",
          border: "1px solid #ccc",
        }}
      >
        <div
          style={{
            width: `${completedPercentage}%`,
            backgroundColor: "green",
          }}
        />
        <div
          style={{
            width: `${overduePercentage}%`,
            backgroundColor: "red",
          }}
        />
      </div>
      <p>
        Completed: {completedCount} | Overdue: {overdueCount} | Total: {total}
      </p>
    </div>
  );
};

export default ProgressBar;
